import {FaTimes} from 'react-icons/fa'
const Tasks = ({task}) => {
  return (
    <div className='task'>
      <h3>{task.text}<FaTimes/></h3>  
      <p>{task.day}</p>
    </div>
  )
}

export default Tasks
